import React from "react";

export default (props) => {
    let arr = []
    for (let key in props.rows[0]) {
        if (key!="fio" && key!="position" && key!="tabNumber") {
            arr.push(key)
        }
    }
    console.log(arr[31] =="fio")
    return (
        <tbody>
        {props.rows.map((item, index) => {
            return (
                <tr>
                    <td>{item.fio}</td>
                    <td>{item.position}</td>
                    <td>{item.tabNumber}</td>
                </tr>
            )}
        )}
        </tbody>
    )
}
